# Objetivo
Iniciar efetivamente a organização do projeto, sendo assim, o time focará em definir as tecnologias que serão utilizadas, se capacitar nas metodologias ágeis que serão utilizadas e iniciar a documentação do projeto.

Nesse contexto, o time começará a desenvolver:

- Capacitação em SCRUM;
- Pesquisas:
  - framework de Typescript para o FrontEnd;
  - framework de Python definido para o Backend;
  - framework de Python escolhido para realizar a raspagem de dados, banco de dados escolhido para o projeto;
  - ferramentas de deploy para o nosso projeto;
  - testar e implementar um projeto com o uso da biblioteca Python Querido Diário;
  - Definir os frameworks e bibliotecas para o frontend.
- Pesquisa sobre o documento de arquitetura!
- Entrega do documento de escolhas tecnológicas.

# Objetivos finais:
- Definir as tecnologias do projeto.
- Definir claramento o escopo do projeto
- Capacitar o time em SCRUM e nas tecnologias escolhidas.
- Criar a documentação do projeto no Git Pages

# Entregas da Sprint:
- Documento de escolhas tecnológicas.

